#import "BDWebImageMacro.h"
#import "BDImageAdapter.h"

@interface BDImageAdapter ()

@property (nonatomic, assign) NSUInteger currentCacheSize;
@property (nonatomic, assign) NSTimeInterval lastRecordTime;

@end

@implementation BDImageAdapter

+ (instancetype)sharedAdapter
{
    static BDImageAdapter *sharedAdapter = nil;
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken, ^{
        sharedAdapter = [[self alloc] init];
    });
    return sharedAdapter;
}

- (instancetype)init
{
    self = [super init];
    if (self) {
        self.currentCacheSize = 0;
        [self updateCacheSize];
        self.options = [[NSUserDefaults standardUserDefaults] integerForKey:@"image_option"];
        self.isPrefetch = [[NSUserDefaults standardUserDefaults] boolForKey:@"image_prefetch"];
        self.isCyclePlayAnim = [[NSUserDefaults standardUserDefaults] boolForKey:@"image_cycle_play"];
//        self.isRetry = [[NSUserDefaults standardUserDefaults] boolForKey:@"image_retry"];
        self.isRetry = YES;
        self.isDecodeForDisplay = [[NSUserDefaults standardUserDefaults] boolForKey:@"image_decode_for_display"];
        self.urls = [self loadUrls];
        self.record = @"";
        [BDWebImageManager sharedManager].enableAllImageDownsample = YES;
    }
    return self;
}

- (void)setOptions:(BDImageRequestOptions)options {
    _options = options;
    [[NSUserDefaults standardUserDefaults] setInteger:options forKey:@"image_option"];
}

- (void)setIsPrefetch:(BOOL)isPrefetch {
    _isPrefetch = isPrefetch;
    [[NSUserDefaults standardUserDefaults] setBool:isPrefetch forKey:@"image_prefetch"];
}

- (void)setIsCyclePlayAnim:(BOOL)isCyclePlayAnim {
    _isCyclePlayAnim = isCyclePlayAnim;
    [[NSUserDefaults standardUserDefaults] setBool:isCyclePlayAnim forKey:@"image_cycle_play"];
}

- (void)setIsRetry:(BOOL)isRetry {
    _isRetry = isRetry;
//    [[NSUserDefaults standardUserDefaults] setBool:isRetry forKey:@"image_retry"];
}

- (void)setIsDecodeForDisplay:(BOOL)isDecodeForDisplay {
    _isDecodeForDisplay = isDecodeForDisplay;
    [BDWebImageManager sharedManager].isDecoderForDisplay = isDecodeForDisplay;
    [[NSUserDefaults standardUserDefaults] setBool:_isDecodeForDisplay forKey:@"image_decode_for_display"];
}

- (void)updateCacheSize {
    dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
        self.currentCacheSize = [BDImageCache sharedImageCache].diskCache.totalSize;
    });
}

- (NSUInteger)cacheSize {
    return self.currentCacheSize;
}

- (void)updateRecord:(NSString *)record {
    if (record.length > 0) {
        self.record = [NSString stringWithFormat:@"%@ \n\n %@", self.record, record];
        if (self.record.length > 10000) {
            self.record = [self.record substringFromIndex:self.record.length - 10000];
        }
        if ([NSDate dateWithTimeIntervalSinceNow:0].timeIntervalSince1970 * 1000 - _lastRecordTime > 500) {
            self.recordBlock(self.record);
            NSDate* date = [NSDate dateWithTimeIntervalSinceNow:0];
            _lastRecordTime = [date timeIntervalSince1970] * 1000;
        }
    }
}

